import React, { useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

export default function ObraSocialForm() {
  const classes = useStyles();
  const [obraSocial, setObraSocial] = useState("");

  const guardarObraSocial = () => {
    if (obraSocial !== "") {
      fetch("http://localhost:8080/obraSocial", {
        method: "post",
        body: JSON.stringify(("nombre": obraSocial)),
      })
        .then(function (response) {
          return response.json();
        })
        .then(function (data) {
          console.log(data);
        });
    }
  };

  return (
    <div className={classes.headerForm}>
      Crear/Editar Obra Social
      <Grid container className={classes.gridForm}>
        <Grid item xs={12} md={12} sm={12} lg={12}>
          <TextField
            variant="outlined"
            margin="normal"
            label={"Obra Social"}
            fullWidth
            value={obraSocial}
            onChange={(event) => setObraSocial(event.target.value)}
          />
        </Grid>
        <Grid item>
          <Button
            variant="contained"
            color="primary"
            onClick={guardarObraSocial}
          >
            Guardar
          </Button>
        </Grid>
      </Grid>
    </div>
  );
}
const useStyles = makeStyles((theme) => ({
  headerForm: {
    textAlign: "center",
    paddingTop: 20,
  },
  gridForm: {
    padding: 10,
  },
}));
